import React , {Component} from 'react'
import '../estilos/navBarstyle.css'
import {Link} from 'react-router-dom'
import '../'

class NavbarExtras extends Component{
    render(){
        return(
            <div className="col-2">
                            <div className="row">
                                <div className="col-6">
                                    <button type="button" className="btn__dark">LOGIN</button>
                                </div>
                                <div className="col-6">
                                    <button type="button" className="btn__dark2">SIGN UP</button>
                                </div>  
                            </div>
                        </div>
        )
    }
}
export default NavbarExtras;
